Вот пример функции на языке Swift, который сортирует массив целых чисел и выводит его на экран:

```swift
func printSortedArray(_ array: [Int]) {
    let sortedArray = array.sorted()
    for number in sortedArray {
        print(number)
    }
}
```

Вы можете вызвать эту функцию следующим образом:

```swift
let numbers = [5, 2, 8, 1, 9]
printSortedArray(numbers)
```

Это вызовет функцию `printSortedArray` и передаст ей массив чисел `[5, 2, 8, 1, 9]`. Затем функция отсортирует этот массив и выведет его элементы в порядке возрастания на экран.

Para hacer esto, necesitarás utilizar la biblioteca Adafruit_Sensor y Adafruit_Dallas de la librería Adafruit para Arduino. Aquí te proporciono un ejemplo de código en C++ que debería funcionar:

```cpp
#include <Wire.h>
#include <Adafruit_Sensor.h>
#include <Adafruit_DallasTemperature.h>

#define DALLAS_PIN D4 // El pin al que están conectados los módulos Dallas

Adafruit_DallasTemperature sensors;

void setup() {
  sensors.begin(DALLAS_PIN);
  Serial.begin(9600);
}

void loop() {
  sensors.requestTemperatures();
  for (int i = 0; i < sensors.getDeviceCount(); i++) {
    float tempC = sensors.getTempCByIndex(i);
    String tempStr = String(tempC, 2);
    Serial.print("Sensor: ");
    Serial.println(i);
    Serial.print("Temperatura: ");
    Serial.println(tempStr + " °C");
  }
  delay(5000); // Espera 5 segundos antes de leer nuevamente
}
```

Este código primero inicializa la conexión del bus I2C y los módulos Dallas. Luego, en cada iteración del bucle principal (`loop()`), solicita las temperaturas de todos los módulos Dallas conectados y las imprime en el monitor serial.

Por favor, asegúrate de ajustar la definición del pin (`DALLAS_PIN`) a la conexión real de tus módulos Dallas a tu ESP32. 

Además, ten en cuenta que este código imprimirá la dirección MAC de cada sensor junto con su temperatura. Si solo deseas imprimir la temperatura, puedes eliminar la parte de la impresión de la dirección MAC.

Claro, aquí tienes un ejemplo básico de cómo puedes implementar el algoritmo de ordenamiento por burbuja en C:

```c
#include <stdio.h>

void bubbleSort(int array[], int size) {
    int i, j, temp;
    for (i = 0; i < size-1; i++) {     
        for (j = 0; j < size-i-1; j++) { 
            if (array[j] > array[j+1]) {
                // intercambia array[j] y array[j+1]
                temp = array[j];
                array[j] = array[j+1];
                array[j+1] = temp;
            }
        }
    }
}

void printArray(int array[], int size) {
    int i;
    for (i=0; i < size; i++)
        printf("%d ", array[i]);
    printf("\n");
}

int main() {
    int data[] = {-2, 45, 0, 11, -9};
    int n = sizeof(data) / sizeof(data[0]);
    bubbleSort(data, n);
    printf("Ordenado: \n");
    printArray(data, n);
    return 0;
}
```

Este código primero define una función `bubbleSort` que realiza el ordenamiento. Luego, define una función `printArray` para imprimir el array después del ordenamiento. Finalmente, en la función `main`, se crea un array, se llama a la función `bubbleSort` para ordenarlo y luego se imprime el array ordenado.

